import React, { Component } from 'react';

class comments extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        const comments_arr = this.props.s_dish.comments.map((dish) => {
            return (
                <p>{dish}</p>
            );
        });
        return (
            { comments_arr }
        );
    }
}
